import { Application } from "../../../app";
import { Scenes } from "../../core/components/assetloader/asset_library";
import { SceneManager } from "../../core/components/assetloader/scene_manager";
import { Scene } from "../../core/data/models/scene";
import { GameObject } from "../../core/components/core/game_object";
import { Vector2 } from "../../utility/math_extended/vector2";

export class ShareScene {
  public name = Scenes.SHARE;

  public sceneManager: SceneManager;
  private currentScene: Scene;

  loaded = false;
  opened = false;

  constructor(sceneManager: SceneManager) {
    this.sceneManager = sceneManager;
    this.sceneManager.currentScene = this.name;
    this.currentScene = new Scene();

    this.sceneManager.LoadScene(Scenes.PRIZE);

    this.PopulateScene();

    Application.instance.OnAppUpdate.sub(this.Update.bind(this));

    document.addEventListener(
      'keydown',
      function(this: ShareScene, event: KeyboardEvent) {
        if (this.sceneManager.currentScene != this.name) return;

        if (event.keyCode == 8 && !this.opened) {
          this.opened = true;
          this.currentScene.Close();
          this.sceneManager.GoToPreviousScene(Scenes.SHARE);
        }

        if (event.keyCode == 13 && !this.opened && this.sceneManager.SceneLoaded(Scenes.PRIZE)) {
          this.opened = true;
          this.currentScene.Close();
          this.sceneManager.GoToNextScene(Scenes.SHARE);
        }
      }.bind(this)
    );
  }

  public Update() {
    if (this.sceneManager.currentScene != this.name) return;
  }

  private PopulateScene() {
    var testObject = new GameObject('Background_Share');
    testObject.transform.position = new Vector2(0, 0);
    testObject.transform.scale = new Vector2(19.2, 9.77);
    this.currentScene.AddGameObject(testObject);
  }
}
